  var $slider = $('.select-slider').slider({
    create: function create(event, ui) {
      var $this = $(this);
      var $select = $this.find('select');

      var values = $select.data('values').split('|');
      var max = values.length - 1;

      var width = 100 / (max + 1) + '%';
      var margin = -0.5 * 100 / max + '%';

      $this.slider('option', 'min', 0);
      $this.slider('option', 'max', max);
      $this.slider('option', 'step', 1);
      $this.slider('option', 'value', 0);
      $this.slider('option', 'range', false);
      $this.slider('option', 'animate', 100);

      $this.
      find('.select-slider_values').
      css({
        marginLeft: margin,
        marginRight: margin });

      $this.
      find('.select-slider_value').
      width(width);
    },
    slide: function slide(event, ui) {
      var $this = $(this);
      var $select = $this.find('select');

      var max = $this.slider('option', 'max');
      var value = ui.value;
      var values = $select.data('values').split('|');
      var fill = value / max * 100 + '%';

      $select.selectedIndex = value;
      $select.val(values[value]);
      $this.find('.select-slider_fill').width(fill);

      // Force form validation
      checkIfValid();
    } });


